import React from 'react';

const Report = ({ report }) => {
    if (!report) {
        return <div>Loading...</div>;
    }

    return (
        <div>
            <h2>Report</h2>
            {report.length > 0 ? (
                <ul>
                    {report.map((item, index) => (
                        <li key={index}>{item.word}</li>
                    ))}
                </ul>
            ) : (
                <p>No data available.</p>
            )}
        </div>
    );
};

export default Report;
